INSERT INTO `messagequestions` (`id`, `question`, `type`, `options`, `answers`) VALUES
(6776, 'Problem is a universal __________, the earlier we learn how to solve them the better for us.', 'Single Answer', 'occurrence,Phenomenom,Phenomenon', 'Phenomenon'),
(6777, '<strong>When you pass through the waters, I will be with you; and through the rivers, they shall not overflow you: when you walk through the fire, you shall not be burned; neither shall the flame kindle upon you.</strong> What bible verse is this?', 'Single Answer', 'Isaiah 42:2,Isaiah 41:2,Isaiah 43:2', 'Isaiah 43:2'),
(6778, '...and that''s what brings us to the theme of today, <strong>The Cost of a _______</strong>', 'Single Answer', 'Destiny,Throne,Crown', 'Crown'),
(6779, '...it''s a common knowledge that it takes _________ to triumph', 'Single Answer', 'weapons,battle,training', 'training'),
(6780, '...in warfare it is how well trained we are that determines how __________ we become', 'Single Answer', 'victorious,triumphant', 'triumphant'),
(6781, '...that''s why in the military setting, _________ is the anchor word', 'Single Answer', 'discipline,drill,training', 'training'),
(6782, 'The only way to show strength in the military setting is __________', 'Single Answer', 'Number,Training', 'Training'),
(6783, '...how equipped we are for the _______ of life is what determines how triumphant we become', 'Single Answer', 'warfare,battles,events', 'battles'),
(6784, '...and if life is a ___________ not a play ground, we need to be equipped for the battles of life', 'Single Answer', 'war zone,battle field', 'battle field'),
(6785, '...life is a _______ not a fun fare', 'Single Answer', 'battle field,war fare,war zone', 'war fare'),
(6786, '<strong>Train up a child in the way he should go: and when he is old, he will not depart from it.</strong> What bible verse is this?', 'Single Answer', 'Proverbs 20:6,Proverbs 21:6,Proverb 22:6,Proverbs 22:6', 'Proverbs 22:6'),
(6787, '...training is most effective through __________', 'Single Answer', 'self discipline,self commitment,self dedication', 'self commitment'),
(6788, '...self commitment is the __________ for effective training', 'Single Answer', 'catalyst,propellant,spring board', 'catalyst'),
(6789, '<strong>But ye, beloved, building up yourselves on your most holy faith, praying in the Holy Ghost,</strong> What bible verse is this?', 'Single Answer', 'Jude 2:20,Jude 1:20,Jude 3:20', 'Jude 1:20'),
(6790, '<strong>And now, brethren, I commend you to God, and to the word of his grace, which is able to build you up, and to give you an inheritance among all them which are sanctified.</strong> What bible verse is this?', 'Single Answer', 'Luke 20:32,Acts 20:32,Romans 4:3', 'Acts 20:32'),
(6791, '...our best training season is ________', 'Single Answer', 'later,now,in 5 years time', 'now'),
(6792, 'Talent is _________, it is training that makes destiny most elastic', 'Single Answer', 'never enough,limited', 'limited'),
(6793, '...any value we don''t succeed to acquire now, it may end up as a _________ that never becomes real', 'Single Answer', 'dream,day dream', 'day dream'),
(6794, '...and your generation has proved that it is now the era of the _______ for delivery of maximum potentials', 'Single Answer', 'adults,youths,children', 'youths'),
(6795, '<strong>Michael Dell</strong> became CEO of Dell Inc. at age _______', 'Single Answer', '20,27,25', '27'),
(6796, '...name all early risers. They were men and women who took _________ earlier than their peers.', 'Single Answer', 'discipline,to training,responsibility', 'responsibility'),
(6797, '...because sacrifice begins with a sense of _________', 'Single Answer', 'worth,direction,responsibility', 'responsibility'),
(6798, '<strong>I have written unto you, fathers, because you have known him that is from the beginning. I have written unto you, young men, because you are strong, and the word of God abides in you, and you have overcome the wicked one.</strong> What bible verse is this?', 'Single Answer', 'John 2:14,1John 2:14,2John 2:14,3John 2:14', '1John 2:14'),
(6799, '...this is our season of strength. If we mis-invest our strength today there is ________ to invest tomorrow', 'Single Answer', 'nothing,no energy,no strength', 'no strength'),
(6800, '...but when our strength today is appropriately invested, we begin to draw _________ from it tomorrow.', 'Single Answer', 'dividends,returns,harvest,fruits', 'harvest'),
(6801, '<strong>And that from a child you have known the holy scriptures, which are able to make thee wise unto salvation through faith which is in Christ Jesus. </strong> What bible verse is this?', 'Single Answer', '1Timothy 3:15,2Timothy 3:15,3Timothy 3:15', '2Timothy 3:15'),
(6802, '...most great destinies have their root from _______', 'Single Answer', 'their youth,childhood', 'childhood'),
(6803, '<strong>The childhood shows the man just as the morning shows the day.</strong> Who said this?', 'Single Answer', 'John Maxwell,James Clarke Maxwell,John Milton', 'John Milton'),
(6804, 'You don''t decide your destiny, you decide your ________ and your ______ decide your destiny', 'Single Answer', 'choices,habits', 'habits'),
(6805, '...the habits of a man today is what defines his __________ tomorrow', 'Single Answer', 'destiny,habitat', 'habitat'),
(6806, '<strong>Seek ye the LORD while he may be found, call ye upon him while he is near:</strong> What bible verse is this?', 'Single Answer', 'Isaiah 5S:6,Isaiah 55:6,Isaiah 45:6', 'Isaiah 55:6'),
(6807, '<strong>Remember now thy Creator in the days of thy youth, while the evil days come not, nor the years draw nigh, when thou shalt say, I have no pleasure in them;</strong> What bible verse is this?', 'Single Answer', 'Ecclesiastes 11:1,Ecclesiastes 12:1,Ecclesiastes 12:4', 'Ecclesiastes 12:1'),
(6808, 'The capital cost for a crown is __________', 'Single Answer', 'Discipline,Diligence,Sacrifice', 'Sacrifice'),
(6809, '...value is a function of ________', 'Single Answer', 'money,price,cost', 'cost'),
(6810, '...how much we are willing to pay is what determines how much ________ we''re out to possess.', 'Single Answer', 'worth,substance,value', 'value'),
(6811, '...the value of any life tomorrow is a function of the _______ that the owner of that life is willing to pay', 'Single Answer', 'price,cost', 'cost'),
(6812, '...it takes our willingness to pay before we can secure a crown. It is not free. True or False?', 'Single Answer', 'True,False', 'True'),
(6813, '<strong>Be not deceived; God is not mocked: for whatsoever a man sows, that shall he also reap. </strong> What bible verse is this?', 'Single Answer', 'Galatians 6:1,Galatians 6:2,Galatians 6:7', 'Galatians 6:7'),
(6814, '...a crown is not what we''re born with, a crown is a value we''re out to _______', 'Single Answer', 'purchase,get,acquire', 'acquire'),
(6815, '<strong>While the earth remaineth, seedtime and harvest, and cold and heat, and summer and winter, and day and night shall not cease.</strong> What bible verse is this?', 'Single Answer', 'Galatians 8:22,Genesis 5:4,Genesis 8:22', 'Genesis 8:22'),
(6816, '...what obtains in our harvest season is a function of the quality of seed we''ve sown in our _______ season.', 'Single Answer', 'nursery,youth,childhood,planting', 'planting'),
(6817, '...those who play around with their planting season end up begging from others when harvest season comes. True or False?', 'Single Answer', 'True,False', 'True'),
(6818, '<strong>But this I say, He which sows sparingly shall reap also sparingly; and he which sows bountifully shall reap also bountifully.</strong> What bible verse is this?', 'Single Answer', '1Corinthians 9:6,2Corinthians 9:6', '2Corinthians 9:6'),
(6819, '<strong>I am come to send fire on the earth; and what will I, if it be already kindled? But I have a baptism to be baptized with; and how am I straitened till it be accomplished!</strong> What bible portion is this?', 'Single Answer', 'Luke 12:49,Luke 12:50,Luke 12:49-50', 'Luke 12:49-50'),
(6820, '...every man that will generate a global impact will pay a _________ price', 'Single Answer', 'heavy,global,huge', 'global'),
(6821, 'There is no free lunch in life. True or False?', 'Single Answer', 'True,False', 'True'),
(6822, 'Nobody wants to pay any ________ and they want to carry every value', 'Single Answer', 'cost,price', 'price'),
(6823, '...if there must be a change there must be a set of people who believe in another approach. And the other approach for dignity and for honor is _______', 'Single Answer', 'Discipline,Sacrifice,Price', 'Sacrifice'),
(6824, '<strong>Seest thou a man diligent in his business? he shall stand before kings; he shall not stand before mean men.</strong> What bible verse is this?', 'Single Answer', 'Proverbs 22:6,Proverbs 22:9,Proverbs 22:29', 'Proverbs 22:29'),
(6825, 'There are _________ broad aspects of our lives.', 'Single Answer', '2,3,4', '2'),
(6826, 'There are 2 broad aspects of our lives. Our spiritual life and our ________ life', 'Single Answer', 'work,career', 'career'),
(6827, '__________ is the security of every destiny, because every life is utterly vulnerable without God', 'Single Answer', 'God first,Spirituality,Knowledge', 'Spirituality'),
(6828, '<strong>For to be carnally minded is death; but to be spiritually minded is life and peace.</strong> What bible verse is this?', 'Single Answer', 'Romans 8:2,Romans 8:4,Romans 8:6', 'Romans 8:6'),
(6829, '...this is our season of _________ accumulations', 'Single Answer', 'insight,faith,revelation', 'revelation'),
(6830, '...these are the times we get to know certain things that will help to stabilize us in the days of trouble in the ______ to come', 'Single Answer', 'times,years', 'years'),
(6831, '...this is where we carry the weapons of ________ into our destiny. It is in the days of our youth that we gather them', 'Single Answer', 'victory,triumph', 'triumph'),
(6832, '<strong>No weapon that is formed against thee shall prosper; and every tongue that shall rise against thee in judgment thou shalt condemn. This is the heritage of the servants of the LORD, and their righteousness is of me, saith the LORD.</strong> What bible verse is this?', 'Single Answer', 'Isaiah 34:17,Isaiah 54:17,Isaiah 44:17', 'Isaiah 54:17'),
(6833, '<strong>...those who do know their God, they shall be strong and they shall do exploits.</strong> What verse of the bible can this statement be found?', 'Single Answer', 'Daniel 11:32,Daniel 10:32,Daniel 12:32', 'Daniel 11:32'),
(6834, 'Do you have to be a pastor to be spiritual?', 'Single Answer', 'Yes,No', 'No'),
(6835, '<strong>When the unclean spirit is gone out of a man, he walks through dry places, seeking rest, and finds none. Then he saith, I will return into my house from whence I came out; and when he is come, he finds it empty, swept, and garnished. Then goes he, and takes with himself seven other spirits more wicked than himself, and they enter in and dwell there: and the last state of that man is worse than the first. Even so shall it be also unto this wicked generation.</strong> What bible portion is this?', 'Single Answer', 'Matthew 12:43,Matthew 12:44,Matthew 12:45,Matthew 12:43-45', 'Matthew 12:43-45'),
(6836, '...without adequate spiritual investment, our destiny is vulnerable. True or False?', 'Single Answer', 'True,False', 'True'),
(6837, '<strong>For he shall give his angels charge over thee, to keep thee in all thy ways.</strong> What bible verse is this?', 'Single Answer', 'Psalms 90:11,Psalms 91:1,Psalms 91:11', 'Psalms 91:11'),
(6838, '...thank God for great careers, but they are no substitute to dealing with the ________ of life', 'Single Answer', 'challenges,problems', 'problems'),
(6839, '...in dealing with real life problems, we need the ___________ and God is the __________ to real life problems', 'Single Answer', 'solution,source of solution,real source of solution', 'real source of solution'),
(6840, '...you use ________ to win spiritual battles', 'Single Answer', 'spiritual weapons,spiritual forces', 'spiritual forces'),
(6841, 'God will always prepare His vessels before He can position them. True or False?', 'Single Answer', 'True,False', 'True'),
(6842, '...there''s a way we''ll build our lives that the enemy will be _______ of you..', 'Single Answer', 'scared,afraid', 'afraid'),
(6843, '...a <strong>Great Enterpreneur</strong>, why not? It''s a great dream. But are you ready for the great price. Which must begin with _________', 'Single Answer', 'information acquisition,information sourcing', 'information sourcing'),
(6844, '...which must begin with information sourcing. Which must begin with a commitment to _________', 'Single Answer', 'unending search,research', 'research'),
(6845, 'How many years did <strong>Charles G. Finney</strong> spend on earth?', 'Single Answer', '73,83,93', '83'),
(6846, 'Who was still riding cross country horse back at the age of 80?', 'Single Answer', 'Billy Graham,Charles G Finney,John Wesley', 'John Wesley'),
(6847, '...I saw many things from many lives, which helped me in making quality decisions at every stage... because <strong>where no counsel is, the people fall: but in the multitude of counselors there is safety.</strong> What bible verse is the highlighted?', 'Single Answer', 'Psalms 11:14,Proverbs 11:14', 'Proverbs 11:14'),
(6848, '...from __________ I learnt, no attack, no defense. Leave everyone to his opinion, face where you are going.', 'Single Answer', 'Charles G Finney,Oswald J Smith,John Wesley', 'Oswald J Smith'),
(6849, '_________ was a vendor boy', 'Single Answer', 'Kim Woo Chung,Kim Woo Choong', 'Kim Woo Choong'),
(6850, 'How much did Kim Woo Choong use to establish <strong>Daewoo Corporation</strong>?', 'Single Answer', '1000,10000,100000', '10000'),
(6851, 'How old is <strong>Kim Woo Choong</strong>?', 'Single Answer', '80,81', '80'),
(6852, '...work is something very precious and cannot be evaluated merely in _________ terms. It is the same with study.', 'Single Answer', 'monetary,financial', 'financial'),
(6853, '...if a business man handles his or her work __________ and takes hobby like joy in it, then the business will gradually grow and its facilities will expand...', 'Single Answer', 'diligently,spontaneously', 'spontaneously'),
(6854, '...<strong>a tireless investment in a bid to improve your lot in our career</strong> is the unpalatable secret of greatness in any pursuit. True or False?', 'Single Answer', 'True,False', 'True'),
(6855, '...when work becomes a thing we really enjoy, we invest in it __________.', 'Single Answer', 'with joy,excitedly', 'excitedly'),
(6856, '...please get out of here knowing that what you invest in your career today is what you _______ there tomorrow.', 'Single Answer', 'see,find out of', 'find out of'),
(6857, '<strong>And wisdom and knowledge shall be the stability of thy times, and strength of salvation: the fear of the LORD is his treasure.</strong> What bible verse is this?', 'Single Answer', 'Isaiah 23:6,Isaiah 33:6,Isaiah 43:6', 'Isaiah 33:6'),
(6858, '__________ was asked, <strong>how many times did you fail?</strong>', 'Single Answer', 'Isaac Newton,Michael Faraday,Albert Einstein', 'Albert Einstein'),
(6859, 'Only those who care to _________ today will enjoy tomorrow', 'Single Answer', 'sacrifice,endure', 'endure'),
(6860, 'If you won''t do what others won''t do, you can''t get above where others will get. True or False?', 'Single Answer', 'True,False', 'True'),
(6861, 'What makes you extraordinary are the ______ you invest', 'Single Answer', 'extra efforts,extras', 'extras'),
(6862, 'What makes anyone outstanding is the ___________ price that he''s paid', 'Single Answer', 'extraordinary,outstanding', 'outstanding'),
(6863, 'Where we find ourselves tomorrow is not God''s making, it is primarily our making. True or False?', 'Single Answer', 'True,False', 'True'),
(6864, 'Sacrifice draws on ______ main things.', 'Single Answer', '2,3,4', '2'),
(6865, 'Sacrifice draws on 2 main things, Discipline and _________', 'Single Answer', 'Commitment,Diligence,Dedication', 'Diligence'),
(6866, '...doing as ________ not as convenient.', 'Single Answer', 'instructed,commanded', 'commanded'),
(6867, '<strong>I have seen servants upon horses, and princes walking as servants upon the earth. He that digs a pit shall fall into it; and whoso breaks an hedge, a serpent shall bite him.</strong> What bible portion is this?', 'Single Answer', 'Ecclesiastes 10:5&7-8,Ecclesiastes 10:7-8,Ecclesiastes 10:5', 'Ecclesiastes 10:7-8');
