(209, 'Matthew', 13, 35, 'Matthew 13:35-This was in fulfillment of what was spoken by the prophet: I will open My mouth in parables; I will utter things that have been hidden since the foundation of the world.', 'Matthew 13:35'),
(210, 'Matthew', 13, 36, 'Matthew 13:36-Then He left the throngs and went into the house. And His disciples came to Him saying, Explain to us the parable of the darnel in the field.', 'Matthew 13:36'),
(211, 'Matthew', 13, 37, 'Matthew 13:37-He answered, He who sows the good seed is the Son of Man.', 'Matthew 13:37'),
(212, 'Matthew', 13, 38, 'Matthew 13:38-The field is the world, and the good seed means the children of the kingdom; the darnel represents the children of the evil one,', 'Matthew 13:38'),
(213, 'Matthew', 13, 39, 'Matthew 13:39-And the enemy who sowed it is the devil. The harvest is the close and consummation of the age, and the reapers are angels.', 'Matthew 13:39'),
(214, 'Matthew', 13, 40, 'Matthew 13:40-Just as the darnel (weeds resembling wheat) is gathered and burned with fire, so it will be at the close of the age.', 'Matthew 13:40'),
(215, 'Matthew', 13, 41, 'Matthew 13:41-The Son of Man will send forth His angels, and they will gather out of His kingdom all causes of offenses [persons by whom others are drawn into error or sin] and all who do iniquity and act wickedly,', 'Matthew 13:41'),
(216, 'Matthew', 13, 42, 'Matthew 13:42-And will cast them into the furnace of fire; there will be weeping and wailing and grinding of teeth.', 'Matthew 13:42'),
(217, 'Matthew', 13, 43, 'Matthew 13:43-Then will the righteous (those who are upright and in right standing with God) shine forth like the sun in the kingdom of their Father. Let him who has ears [to hear] be listening, and let him consider and perceive and understand by hearing.', 'Matthew 13:43'),
(218, 'Matthew', 13, 44, 'Matthew 13:44-The kingdom of heaven is like something precious buried in a field, which a man found and hid again; then in his joy he goes and sells all he has and buys that field.', 'Matthew 13:44'),
(219, 'Matthew', 13, 45, 'Matthew 13:45-Again the kingdom of heaven is like a man who is a dealer in search of fine and precious pearls,', 'Matthew 13:45'),
(220, 'Matthew', 13, 46, 'Matthew 13:46-Who, on finding a single pearl of great price, went and sold all he had and bought it.', 'Matthew 13:46'),
(221, 'Matthew', 13, 47, 'Matthew 13:47-Again, the kingdom of heaven is like a dragnet which was cast into the sea and gathered in fish of every sort.', 'Matthew 13:47'),
(222, 'Matthew', 13, 48, 'Matthew 13:48-When it was full, men dragged it up on the beach, and sat down and sorted out the good fish into the baskets, but the worthless ones they threw away.', 'Matthew 13:48'),
(223, 'Matthew', 13, 49, 'Matthew 13:49-So it will be at the close and consummation of the age. The angels will go forth and separate the wicked from the righteous.', 'Matthew 13:49'),
(224, 'Matthew', 13, 50, 'Matthew 13:50-And cast them [the wicked] into the furnace of fire; there will be weeping and wailing and grinding of teeth.', 'Matthew 13:50'),
(225, 'Matthew', 13, 51, 'Matthew 13:51-Have you understood all these things taken together? They said to Him, Yes, Lord.', 'Matthew 13:51'),
(226, 'Matthew', 13, 52, 'Matthew 13:52-He said to them, Therefore every teacher and interpreter of the Sacred Writings who has been instructed about and trained for the kingdom of heaven and has become a disciple is like a householder who brings forth out of his storehouse treasure that is new and [treasure that is] old [the fresh as well as the familiar]', 'Matthew 13:52'),
(227, 'Matthew', 13, 53, 'Matthew 13:53-When Jesus had finished these parables, He left there.', 'Matthew 13:53'),
(228, 'Matthew', 13, 54, 'Matthew 13:54-And coming to His own country, He taught in their synagogue so that they were amazed with bewildered wonder, and said, Where did this Man get this wisdom and these miraculous powers?', 'Matthew 13:54'),
(229, 'Matthew', 13, 55, 'Matthew 13:55-Is not this the carpenter''s Son? Is not His mother called Mary? And are not His brothers James and Joseph and Simon and Judas?', 'Matthew 13:55'),
(230, 'Matthew', 13, 56, 'Matthew 13:56-And do not all His sisters live here among us? Where then did this Man get all this?', 'Matthew 13:56'),
(231, 'Matthew', 13, 57, 'Matthew 13:57-And they took offense at Him [they were repelled and hindered from acknowledging His authority, and caused to stumble]. But Jesus said to them, A prophet is not without honor except in his own country and in his own house.', 'Matthew 13:57'),
(232, 'Matthew', 13, 58, 'Matthew 13:58-And He did not do many mighty works there, because of their unbelief (their lack of faith in the divine mission of Jesus).', 'Matthew 13:58'),
(233, 'Luke', 8, 1, 'Luke 8:1-Soon afterward, [Jesus] went on through towns and villages, preaching and bringing the good news (the Gospel) of the kingdom of God. And the twelve [apostles] were with Him.', 'Luke 8:1'),
(234, 'Luke', 8, 2, 'Luke 8:2-And also some women who had been cured of evil spirits and diseases: Mary, called Magdalene, from whom seven demons had been expelled;', 'Luke 8:2'),
(235, 'Luke', 8, 3, 'Luke 8:3-And Joanna, the wife of Chuza, Herod''s household manager; and Susanna; and many others, who ministered to and provided for Him out of their substance.', 'Luke 8:3'),
(236, 'Luke', 8, 4, 'Luke 8:4-And when a very great throng was gathering together and people from town after town kept coming to Jesus, He said in a parable:', 'Luke 8:4'),
(237, 'Luke', 8, 5, 'Luke 8:5-A sower went out to sow seed; and as he sowed, some fell along the traveled path and was trodden underfoot, and the birds of the air ate it up.', 'Luke 8:5'),
(238, 'Luke', 8, 6, 'Luke 8:6-And some [seed] fell on the rock, and as soon as it sprouted, it withered away because it had no moisture.', 'Luke 8:6'),
(239, 'Luke', 8, 7, 'Luke 8:7-And other [seed] fell in the midst of the thorns, and the thorns grew up with it and choked it.', 'Luke 8:7'),
(240, 'Luke', 8, 8, 'Luke 8:8-And some seed fell into good soil, and grew up and yielded a crop a hundred times [as great]. As He said these things, He called out, He who has ears to hear, let him hear.', 'Luke 8:8'),
(241, 'Luke', 8, 9, 'Luke 8:9-And when His disciples asked Him the meaning of this parable,', 'Luke 8:9'),
(242, 'Luke', 8, 10, 'Luke 8:10-He said to them, To you it has been given to know the mysteries and secrets of the kingdom of God, but for others they are in parables, so that, looking, they may not see; and hearing, they may not comprehend.', 'Luke 8:10'),
(243, 'Luke', 8, 11, 'Luke 8:11-Now the meaning of the parable is this: The seed is the Word of God.', 'Luke 8:11'),
(244, 'Luke', 8, 12, 'Luke 8:12-Those along the traveled road are the people who have heard; then the devil comes and carries away the message out of their hearts, that they may not believe and be saved.', 'Luke 8:12'),
(245, 'Luke', 8, 13, 'Luke 8:13-And those upon the rock [are the people] who, when they hear [the Word], receive and welcome it with joy; but these have no root. They believe for a while, and in time of trial and temptation fall away.', 'Luke 8:13'),
(246, 'Luke', 8, 14, 'Luke 8:14-And as for what fell among thorns, these are [the people] who hear, but as they go on their way they are choked and suffocated with the anxieties and cares and riches and pleasures of life, and their fruit does not ripen.', 'Luke 8:14'),
(247, 'Luke', 8, 15, 'Luke 8:15-But as for the [seed] in the good soil, these are [the people] who, hearing the Word, hold it fast in a just (noble, virtuous) and worthy heart, and steadily bring forth fruit with patience.', 'Luke 8:15'),
(248, 'Luke', 8, 16, 'Luke 8:16-No one after he has lighted a lamp covers it with a vessel or puts it under a couch; but he puts it on a lamp stand, that those who come in may see the light.', 'Luke 8:16'),
(249, 'Luke', 8, 17, 'Luke 8:17-For there is nothing hidden that shall not be disclosed, nor anything secret that shall not be known and come out into the open.', 'Luke 8:17'),
(250, 'Luke', 8, 18, 'Luke 8:18-Be careful therefore how you listen. For to him who has [spiritual knowledge] will more be given; and from him who does not have [spiritual knowledge], even what he has will be taken away.', 'Luke 8:18'),
(251, 'Luke', 8, 19, 'Luke 8:19-Then Jesus'' mother and His brothers came along toward Him, but they could not get to Him because of the crowd.', 'Luke 8:19'),
(252, 'Luke', 8, 20, 'Luke 8:20-And it was told Him, Your mother and Your brothers are standing outside, desiring to see You.', 'Luke 8:20'),
(253, 'Luke', 8, 21, 'Luke 8:21-But He answered them, My mother and My brothers are those who listen to the Word of God and do it!', 'Luke 8:21'),
(254, 'Luke', 8, 22, 'Luke 8:22-One of those days He and His disciples got into a boat, and He said to them, Let us go across to the other side of the lake. So they put out to sea.', 'Luke 8:22'),
(255, 'Luke', 8, 23, 'Luke 8:23-But as they were sailing, He fell off to sleep. And a whirlwind revolving from below upwards swept down on the lake, and the boat was filling with water, and they were in great danger.', 'Luke 8:23'),
(256, 'Luke', 8, 24, 'Luke 8:24-And the disciples came and woke Him, saying, Master, Master, we are perishing! And He, being thoroughly awakened, censured and blamed and rebuked the wind and the raging waves; and they ceased, and there came a calm.', 'Luke 8:24'),
(257, 'Luke', 8, 25, 'Luke 8:25-And He said to them, [Why are you so fearful?] Where is your faith? And they were seized with alarm and profound and reverent dread, and they marveled, saying to one another, Who then is this, that He commands even wind and sea, and they obey Him?', 'Luke 8:25'),
(258, 'Luke', 8, 26, 'Luke 8:26-Then they came to the country of the Gerasenes, which is opposite Galilee.', 'Luke 8:26'),
(259, 'Luke', 8, 27, 'Luke 8:27-Now when Jesus stepped out on land, there met Him a certain man out of the town who was possessed by demons. For a long time he had worn no clothes, and he lived not in a house but in the tombs.', 'Luke 8:27'),
(260, 'Luke', 8, 28, 'Luke 8:28-And when he saw Jesus, he raised a deep cry and fell down before Him and shouted loudly, What have You [to do] with me, Jesus, Son of the Most High God? I beg You, do not torment me!', 'Luke 8:28'),
(261, 'Luke', 8, 29, 'Luke 8:29-For Jesus was already commanding the unclean spirit to come out of the man. For many times it had snatched and held him; he was kept under guard and bound with chains and fetters, but he would break the bonds and be driven by the demon into the wilderness.', 'Luke 8:29'),
(262, 'Luke', 8, 30, 'Luke 8:30-Jesus then asked him, What is your name? And he answered, Legion; for many demons had entered him.', 'Luke 8:30'),
(263, 'Luke', 8, 31, 'Luke 8:31-And they begged [Jesus] not to command them to depart into the Abyss (bottomless pit)', 'Luke 8:31'),
(264, 'Luke', 8, 32, 'Luke 8:32-Now a great herd of swine was there feeding on the hillside; and [the demons] begged Him to give them leave to enter these. And He allowed them [to do so].', 'Luke 8:32'),
(265, 'Luke', 8, 33, 'Luke 8:33-Then the demons came out of the man and entered into the swine, and the herd rushed down the steep cliff into the lake and were drowned.', 'Luke 8:33'),
(266, 'Luke', 8, 34, 'Luke 8:34-When the herdsmen saw what had happened, they ran away and told it in the town and in the country.', 'Luke 8:34'),
(267, 'Luke', 8, 35, 'Luke 8:35-And [people] went out to see what had occurred, and they came to Jesus and found the man from whom the demons had gone out, sitting at the feet of Jesus, clothed and in his right mind; and they were seized with alarm and fear.', 'Luke 8:35'),
(268, 'Luke', 8, 36, 'Luke 8:36-And those who had seen it told them how he who had been possessed with demons was restored.', 'Luke 8:36'),
(269, 'Luke', 8, 37, 'Luke 8:37-Then all the people of the country surrounding the Gerasenes'' district asked [Jesus] to depart from them, for they were possessed and suffering with dread and terror; so He entered a boat and returned [to the west side of the Sea of Galilee].', 'Luke 8:37'),
(270, 'Luke', 8, 38, 'Luke 8:38-But the man from whom the demons had gone out kept begging and praying that he might accompany Him and be with Him, but [Jesus] sent him away, saying,', 'Luke 8:38'),
(271, 'Luke', 8, 39, 'Luke 8:39-Return to your home, and show how great things God has done to you. And [the man] departed, proclaiming throughout the whole city how much Jesus had done for him.', 'Luke 8:39'),
(272, 'Luke', 8, 40, 'Luke 8:40-Now when Jesus came back [to Galilee], the crowd received and welcomed Him gladly, for they were all waiting and looking for Him.', 'Luke 8:40'),
(273, 'Luke', 8, 41, 'Luke 8:41-And there came a man named Jairus, he was a ruler of the synagogue; and falling at the feet of Jesus, he begged Him to come to his house,', 'Luke 8:41'),
(274, 'Luke', 8, 42, 'Luke 8:42-For he had only one daughter, about twelve years of age, and she was dying. As [Jesus] went, the people pressed together around Him.', 'Luke 8:42'),
(275, 'Luke', 8, 43, 'Luke 8:43-And a woman who had suffered from a flow of blood for twelve years and had spent all her living upon physicians, and could not be healed by anyone,', 'Luke 8:43'),
(276, 'Luke', 8, 44, 'Luke 8:44-Came up behind Him and touched the fringe of His garment, and immediately her flow of blood ceased.', 'Luke 8:44'),
(277, 'Luke', 8, 45, 'Luke 8:45-And Jesus said, Who is it who touched Me? When all were denying it, Peter and those who were with him said, Master, the multitudes surround You and press You on every side!', 'Luke 8:45'),
(278, 'Luke', 8, 46, 'Luke 8:46-But Jesus said, Someone did touch Me; for I perceived that virtue is gone out of Me.', 'Luke 8:46'),
(279, 'Luke', 8, 47, 'Luke 8:47-And when the woman saw that she had not escaped notice, she came up trembling, and, falling down before Him, she declared in the presence of all the people for what reason she had touched Him and how she had been instantly cured.', 'Luke 8:47'),
(280, 'Luke', 8, 48, 'Luke 8:48-And He said to her, Daughter, your faith has made you well! Go in peace.', 'Luke 8:48'),
(281, 'Luke', 8, 49, 'Luke 8:49-While He was still speaking, a man from the house of the director of the synagogue came and said [to Jairus], Your daughter is dead; do not weary and trouble the Teacher any further.', 'Luke 8:49'),
(282, 'Luke', 8, 50, 'Luke 8:50-But Jesus, on hearing this, answered him, Do not be seized with alarm or struck with fear; simply believe, and she shall be made well.', 'Luke 8:50'),
(283, 'Luke', 8, 51, 'Luke 8:51-And when He came to the house, He permitted no one to enter with Him except Peter and John and James, and the girl''s father and mother.', 'Luke 8:51'),
(284, 'Luke', 8, 52, 'Luke 8:52-And all were weeping for and bewailing her; but He said, Do not weep, for she is not dead but sleeping.', 'Luke 8:52'),
(285, 'Luke', 8, 53, 'Luke 8:53-And they laughed Him to scorn, knowing full well that she was dead.', 'Luke 8:53'),
(286, 'Luke', 8, 54, 'Luke 8:54-And grasping her hand, He called, saying, Child, arise.', 'Luke 8:54'),
(287, 'Luke', 8, 55, 'Luke 8:55-And her spirit returned, and she arose immediately; and He directed that she should be given something to eat.', 'Luke 8:55'),
(288, 'Luke', 8, 56, 'Luke 8:56-And her parents were amazed, but He charged them to tell no one what had occurred.', 'Luke 8:56'),
(289, 'Matthew', 8, 14, 'Matthew 8:14-And when Jesus went into Peter''s house, He saw his mother-in-law lying ill with a fever.', 'Matthew 8:14'),
(290, 'Matthew', 8, 15, 'Matthew 8:15-He touched her hand and the fever left her; and she got up and began waiting on Him.', 'Matthew 8:15'),
(291, 'Matthew', 8, 16, 'Matthew 8:16-When evening came, they brought to Him many who were under the power of demons, and He drove out the spirits with a word and restored to health all who were sick.', 'Matthew 8:16'),
(292, 'Matthew', 8, 17, 'Matthew 8:17-And thus He fulfilled what was spoken by the prophet Isaiah, He Himself took our weaknesses and infirmities and bore away our diseases.', 'Matthew 8:17'),
(293, 'Matthew', 8, 18, 'Matthew 8:18-Now Jesus, when He saw the great throngs around Him, gave orders to cross to the other side [of the lake].', 'Matthew 8:18'),
(294, 'Matthew', 8, 19, 'Matthew 8:19-And a scribe came up and said to Him, Master, I will accompany You wherever You go.', 'Matthew 8:19'),
(295, 'Matthew', 8, 20, 'Matthew 8:20-And Jesus replied to him, Foxes have holes and the birds of the air have lodging places, but the Son of Man has nowhere to lay His head.', 'Matthew 8:20'),
(296, 'Matthew', 8, 21, 'Matthew 8:21-Another of the disciples said to Him, Lord, let me first go and bury my father.', 'Matthew 8:21'),
(297, 'Matthew', 8, 22, 'Matthew 8:22-But Jesus said to him, Follow Me, and leave the dead to bury their own dead.', 'Matthew 8:22'),
(298, 'Matthew', 8, 23, 'Matthew 8:23-And after He got into the boat, His disciples followed Him.', 'Matthew 8:23'),
(299, 'Matthew', 8, 24, 'Matthew 8:24-And suddenly, behold, there arose a violent storm on the sea, so that the boat was being covered up by the waves; but He was sleeping.', 'Matthew 8:24'),
(300, 'Matthew', 8, 25, 'Matthew 8:25-And they went and awakened Him, saying, Lord, rescue and preserve us! We are perishing!', 'Matthew 8:25'),
(301, 'Matthew', 8, 26, 'Matthew 8:26-And He said to them, Why are you timid and afraid, O you of little faith? Then He got up and rebuked the winds and the sea, and there was a great and wonderful calm.', 'Matthew 8:26'),
(302, 'Matthew', 8, 27, 'Matthew 8:27-And the men were stunned with bewildered wonder and marveled, saying, What kind of Man is this, that even the winds and the sea obey Him!', 'Matthew 8:27'),
(303, 'Matthew', 8, 28, 'Matthew 8:28-And when He arrived at the other side in the country of the Gadarenes, two men under the control of demons went to meet Him, coming out of the tombs, so fierce and savage that no one was able to pass that way.', 'Matthew 8:28'),
(304, 'Matthew', 8, 29, 'Matthew 8:29-And behold, they shrieked and screamed, What have You to do with us, Jesus, Son of God? Have You come to torment us before the appointed time?', 'Matthew 8:29'),
(305, 'Matthew', 8, 30, 'Matthew 8:30-Now at some distance from there a drove of many hogs were grazing.', 'Matthew 8:30'),
(306, 'Matthew', 8, 31, 'Matthew 8:31-And the demons begged Him, If You drive us out, send us into the drove of hogs.', 'Matthew 8:31'),
(307, 'Matthew', 8, 32, 'Matthew 8:32-And He said to them, Begone! So they came out and went into the hogs, and behold, the whole drove rushed down the steep bank into the sea and died in the water.', 'Matthew 8:32'),
(308, 'Matthew', 8, 33, 'Matthew 8:33-The herdsmen fled and went into the town and reported everything, including what had happened to the men under the power of demons.', 'Matthew 8:33'),
(309, 'Matthew', 8, 34, 'Matthew 8:34-And behold, the whole town went out to meet Jesus; and as soon as they saw Him, they begged Him to depart from their locality.', 'Matthew 8:34');
